char A[19], B[19];
int length;

int compare() {
    int i = length;
    while (i--) if (*(A+i) != *(B+i)) return 1;
    return 0;
}

void transform() {
    length = strlen(B);
    int l1 = strlen(A), 
        diff = length - l1, i = 0;

    char c[19] = {0};
    if (diff) {
        while (i < diff) {
            *(c + i) = 48;
            i++;
        }
        l1 += diff;
        while (i < l1) {
            *(c + i) = *(A + i - diff);
            i++;
        }
        strcpy(A, c);
    }
}

void increment() {
    int i = length - 1;
    while (*(A+i) == 57) *(A+i--) = 48;
    *(A+i) += 1;
}

int check_lucky() {
    int sum = 0, sum_square = 0, i = length;
    char x;

    while (i--) {
        x = *(A + i) - 48;
        sum += x;
        sum_square += x * x;
    }
    
    return *(prime_map+sum) & *(prime_map+sum_square);
}

int main()
{
    int T, count;
    
    scanf("%d", &T);
    while (T--) {
        scanf("%s %s", A, B);
        count = 0;
        transform();
        while (compare()) {
            if (check_lucky()) count++;
            increment();
            
        }
        printf("%d\n", count);
    }
    
    return 0;
}